import{_ as e,c as a,o as t,a2 as r}from"./chunks/framework.BY0EG3at.js";const s="/coconut/dashboard-analysis.png",_=JSON.parse('{"title":"Data analysis","description":"","frontmatter":{},"headers":[],"relativePath":"analysis.md","filePath":"analysis.md"}'),i={name:"analysis.md"},n=r('<h1 id="data-analysis" tabindex="-1">Data analysis <a class="header-anchor" href="#data-analysis" aria-label="Permalink to &quot;Data analysis&quot;">​</a></h1><ul><li><p>As shown in the <a href="./collections.html">sources</a> section, COCONUT data has been extracted from 63 data sources and several have been manually collected from literature sets.</p></li><li><p>Currently, The database catalogs a total of 695,133 chemical molecules, with 89,593 being non-stereo (lacking stereoisomers) and 555,897 stereo molecules (exhibiting stereoisomerism). Of the stereo molecules, 415,768 are unique parent structures without stereochemical modifications. The platform organizes these molecules into 63 distinct collections and has been cited 24,272 times in scientific literature. It includes data on 55,252 organisms and 2,653 geographical locations, highlighting a broad diversity in sources. Currently, there are no available reports on the platform. Please refer to the original <a href="https://doi.org/10.1186/s13321-020-00478-9" target="_blank" rel="noreferrer">paper</a> for more details.</p></li><li><p>We extensively use the <a href="https://www.ebi.ac.uk/chembl/" target="_blank" rel="noreferrer">ChEMBL</a> <a href="https://jcheminf.biomedcentral.com/articles/10.1186/s13321-020-00456-1" target="_blank" rel="noreferrer">structure curation pipeline</a> developed with <a href="https://www.rdkit.org/" target="_blank" rel="noreferrer">RDKit</a> to clean the data and curate the database.</p></li></ul><p><img src="'+s+'" alt="Dashboard"></p><h2 id="curation-steps" tabindex="-1">Curation steps <a class="header-anchor" href="#curation-steps" aria-label="Permalink to &quot;Curation steps&quot;">​</a></h2><ul><li>The snapshot of the PostgreSQL database form the COCONUT release 2024 was taken as the primary source, <ul><li>Polyfluorinated compounds (64 in total) were removed</li><li>Structures that cannot be parsed by the ChEMBL structure curation pipeline (113 in total) have been removed.</li><li>Duplicates have been merged into one entry and the highly annotated entry has been made the parent entry, and the remainder is now included in the parent entry.</li></ul></li></ul>',5),o=[n];function l(c,h,d,u,p,m){return t(),a("div",null,o)}const b=e(i,[["render",l]]);export{_ as __pageData,b as default};
